  return (
    <Router>
      <div className="min-h-screen bg-gray-100 flex flex-col justify-center items-center">
        <Routes>
          <Route path="/" element={<CreatePaperWithUser />} />
          <Route path="/users" element={<viewUsers />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
